import React from "react";
import { ContentHeader, i18n } from "config/C4";

const PersonalView = () => {
  const { personalview } = i18n();
  return (
    <div className="personalView">
      <ContentHeader title={personalview.title} />
      <h1 className="personalView__introduction">
        {personalview.introduction.map((part) => {
          if (part.type !== "") {
            return <span>{part.content}</span>;
          } else {
            return <>{part.content}</>;
          }
        })}
      </h1>
      <p className="personalView__copy">
        {personalview.copy}
      </p>

      <div className="personalView__information">
        <h2>{personalview.personalInformation}</h2>
        <p>{personalview.name}: Janneke Maria Coumans</p>
        <p>{personalview.phone}: <a href="tel:0622887662">+316 2288 7662</a></p>
        <p>{personalview.email}: <a href="mailto:jannekecoumans@gmail.com">Jannekecoumans@gmail.com</a></p>
        <p>{personalview.address}: Pontanusstraat 1C, 6524HA, Nijmegen, Netherlands</p>
        <p>{personalview.birthdate}: 24-02-1990</p>
      </div>
    </div>
  );
};

export default PersonalView;
